"use client"

import { useState, useContext } from "react"
import axios from "axios"
import { AuthContext } from "../../context/AuthContext"
import { API_URL } from "../../config"

const CreateTicketForm = ({ addTicket }) => {
  const { user } = useContext(AuthContext)
  const [formData, setFormData] = useState({
    title: "",
    description: "",
  })
  const [loading, setLoading] = useState(false)
  const [error, setError] = useState("")
  const [success, setSuccess] = useState("")

  const { title, description } = formData

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value })
  }

  const handleSubmit = async (e) => {
    e.preventDefault()
    setError("")
    setSuccess("")
    setLoading(true)

    try {
      const config = {
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${user.token}`,
        },
      }

      const res = await axios.post(`${API_URL}/api/tickets`, formData, config)

      addTicket(res.data)
      setFormData({
        title: "",
        description: "",
      })
      setSuccess("Ticket created successfully")

      // Clear success message after 3 seconds
      setTimeout(() => setSuccess(""), 3000)
    } catch (err) {
      setError(err.response?.data?.message || "Failed to create ticket")
    } finally {
      setLoading(false)
    }
  }

  return (
    <div className="overflow-hidden rounded-lg border border-gray-200 bg-white shadow-soft dark:border-gray-700 dark:bg-gray-800">
      <div className="border-b border-gray-200 bg-gray-50 px-4 py-3 dark:border-gray-700 dark:bg-gray-800/50">
        <h3 className="text-lg font-medium text-gray-900 dark:text-white">Create New Ticket</h3>
        <p className="mt-1 text-sm text-gray-500 dark:text-gray-400">Submit a new support request</p>
      </div>

      {error && (
        <div className="mx-4 mt-4 rounded-lg bg-red-50 p-3 dark:bg-red-900/30">
          <p className="text-sm text-red-700 dark:text-red-200">{error}</p>
        </div>
      )}

      {success && (
        <div className="mx-4 mt-4 rounded-lg bg-green-50 p-3 dark:bg-green-900/30">
          <p className="text-sm text-green-700 dark:text-green-200">{success}</p>
        </div>
      )}

      <form onSubmit={handleSubmit} className="p-4">
        <div className="mb-4">
          <label htmlFor="title" className="mb-2 block text-sm font-medium text-gray-700 dark:text-gray-300">
            Title
          </label>
          <input
            type="text"
            id="title"
            name="title"
            value={title}
            onChange={handleChange}
            required
            placeholder="Brief description of the issue"
            className="block w-full rounded-lg border border-gray-300 bg-white px-3 py-2 shadow-sm transition-colors focus:border-primary-500 focus:outline-none focus:ring-1 focus:ring-primary-500 dark:border-gray-600 dark:bg-gray-700 dark:text-white dark:focus:border-primary-500"
          />
        </div>

        <div className="mb-4">
          <label htmlFor="description" className="mb-2 block text-sm font-medium text-gray-700 dark:text-gray-300">
            Description
          </label>
          <textarea
            id="description"
            name="description"
            value={description}
            onChange={handleChange}
            required
            rows="5"
            placeholder="Provide details about your issue"
            className="block w-full rounded-lg border border-gray-300 bg-white px-3 py-2 shadow-sm transition-colors focus:border-primary-500 focus:outline-none focus:ring-1 focus:ring-primary-500 dark:border-gray-600 dark:bg-gray-700 dark:text-white dark:focus:border-primary-500"
          ></textarea>
        </div>

        <button
          type="submit"
          disabled={loading}
          className="relative w-full rounded-lg bg-gradient-to-r from-primary-500 to-secondary-500 px-4 py-2 text-sm font-medium text-white transition-all hover:from-primary-600 hover:to-secondary-600 focus:outline-none focus:ring-2 focus:ring-primary-500 focus:ring-offset-2 disabled:opacity-50"
        >
          {loading ? (
            <>
              <span className="absolute left-1/2 top-1/2 block h-4 w-4 -translate-x-1/2 -translate-y-1/2 animate-spin rounded-full border-2 border-white border-t-transparent"></span>
              <span className="opacity-0">Creating...</span>
            </>
          ) : (
            "Submit Ticket"
          )}
        </button>
      </form>
    </div>
  )
}

export default CreateTicketForm
